// 做的事：plotTile -> 画中间位置 -> 擦中间位置 -> 画终点位置
void moveCharacter(int initialX, int initialY, int dir);
//可以画【一个】指定index的tile，可以指定颜色
void plotOneTile(int x, int y, short int colour);
//根据global variable的board，来redraw
void redrawBoard(void);
// updates given (x,y) coordinates given the arrow key pressed
void updateCoordinate(int key, int* x, int* y);
void backBufferSync(void);
	
	
