void animation(){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);//back buffer
	if(delay != 0){
		delay--;
	}
	else{
		if(duckIdx == 0){
			IdxDelta = 1;
		}else if(duckIdx == 2){
			IdxDelta = -1;
		}
		duckIdx += IdxDelta;
		delay = 5;
	}
	
	plotOneTile(characterX, characterY, grey);
	placeCharacter(characterX, characterY, duckState[duckIdx], false);
			
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr);
}

int poll_user_input(bool restrictTime){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    // returns the key pressed by user
    // note: reading from the data register will remove one byte from data

	volatile int * keyboard_ptr = (int *)0xFF200100;
    volatile int * timer_ptr = (int *)0xFFFEC600;

    bool timesUp = false;

    //set up the timer
    *(timer_ptr) = 100000000; // 0.5 seconds
    *(timer_ptr + 2) = 1; // set E bit
	*(timer_ptr + 3) = 1; // reset F bit
	int count = 10;
	unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
	// poll for break code
	while (count != 0){
		if(restrictTime){ //鸭子动画
			animation();
		}

        if (restrictTime){
            // last bit of interrupt status register
            timesUp = *(timer_ptr + 3) & 1;
        }
		if(restrictTime && timesUp){
			//如果0.5秒结束，reset timer
			*(timer_ptr) = 100000000; // 0.5 seconds
			*(timer_ptr + 2) = 1; // set E bit
			*(timer_ptr + 3) = 1; // reset F bit
			timesUp = false;

			drawCountDown(duckCatchMe);

			if(count % 2 == 1){
				deleteString();
			}
			else if(count == 10){
				printString(5,3,"Catch Me!", 10);
				printString(5,4,"You have", 9);
				printString(4,5,"5 sec left", 10);
			}else if(count == 8){
				printString(5,3,"Catch Me!", 10);
				printString(5,4,"You have", 9);
				printString(4,5,"4 sec left", 10);
			}else if(count == 6){
				printString(5,3,"Catch Me!", 10);
				printString(5,4,"You have", 9);
				printString(4,5,"3 sec left", 10);
			}else if(count == 4){
				printString(5,3,"Catch Me!", 10);
				printString(5,4,"You have", 9);
				printString(4,5,"2 sec left", 10);
			}else if(count == 2){
				printString(5,3,"Catch Me!", 10);
				printString(5,4,"You have", 9);
				printString(4,5,"1 sec left", 10);
			}

			count--;
		}

		byte1 = byte2;
        byte2 = byte3;
        byte3 = *(keyboard_ptr) & 0xFF;
		
		if (byte2 == 0xF0){
            // SPACE
            if (byte3 == 0x29){
                return SPACE;
            }
            // R
            else if (byte3 == 0x2D){
                return R;
            }
		}
		
        else if (byte1 == 0xE0){

			// UP
			if (byte3 == 0x75){
				return UP;
			}
			// DOWN
			else if (byte3 == 0x72){
				return DOWN;
			}
			// LEFT
			else if (byte3 == 0x6B){
				return LEFT;
			}
			// RIGHT
			else if (byte3 == 0x74){
				return RIGHT;
			} 	
			    
        }
	}
    return SPACE;
}


