void placeObstacle(int x, int y){
	int count = 0;
	const int xOffset = 92;
	const int yOffset = 13;
	int xOff;
	
	if (y % 2 != 0) {
		xOff = xOffset + 12;
	}
	else {
		xOff = xOffset;
	}

	int xLoop, yLoop;
	for(yLoop = 0; yLoop < 22; yLoop++){
		for(xLoop = 0; xLoop < 22; xLoop++){
			if(obstacle[count] != white){
				plot_pixel(xOff + x * 31 + xLoop, 
						   yOffset + y * 32 + yLoop,  
						   obstacle[count]);
			}
			count++;
		}
	}
	board[y][x] = OBSTACLE;
}


bool valid_place(int board[7][7], int x, int y){
	// return true if an object can be placed at the specified index
	
	// object at specified index
	if (board[y][x] == EMPTY && 
		x <= 6 && x >= 0 &&
	    y <= 6 && y >= 0){
		return true;
	}
	return false;
}

void move_select(int board[7][7], int prev_x, int prev_y, int new_x, int new_y){
	// moves the select object to the specified index

    int prev_x_offset, new_x_offset;
    int y_offset = 10;
	
	int i, j;
    int count;
	
	if (valid_place(board, new_x, new_y)){

        // calculate col_offset
        if (prev_y % 2 != 0){
            prev_x_offset = 88 + 12;
        }
        else{
            prev_x_offset = 88;
        }
		
		if (new_y % 2 != 0){
            new_x_offset = 88 + 12;
        }
        else{
            new_x_offset = 88;
        }
		
        count = 0;
        for (i = 0; i < 30; i++) {
            for (j = 0; j < 30; j++) {
                if(tile[count] != white){
					// erase previous select (cover with grey tile)
                    plot_pixel(prev_x_offset + j + prev_x * 31, 
                               y_offset + i + prev_y * 32, 
                               grey);
					
					// plot new select（cover with blue tile）
                    plot_pixel(new_x_offset + j + new_x * 31, 
							   y_offset + i + new_y * 32, 
                               blue);
                }
                count++;
            }
        }
	}
}

void placeCharacter(int x, int y, short int* array, bool isRun){
	int row, col;
	int count = 0;
	const int rowOffset = 94;
	const int colOffset = 12;
	int row_off;
	int col_off = colOffset;
	int colBound = 26;
	int rowBound = 18;
		
	if(y % 2 != 0) row_off = rowOffset + 12;
	else row_off = rowOffset;
	
	if(isRun){ //正在plot奔跑的人，而不是站着的人，图片尺寸不一样，且开始位置不一样
		colBound = 30; rowBound = 30;
		if(array == toUpLeft){
			row_off -= 6;
			col_off -= 16;
		}
		else if(array == toUpRight){
			row_off += 4;
			col_off -= 16;
		}
		else if(array == toRight){
			row_off += 12;
		}
		else if(array == toBottomRight){
			row_off += 4;
			col_off += 16;
		}
		else if(array == toBottomLeft){
			row_off -= 12;
			col_off += 16;
		}
		else if(array == toLeft){
			row_off -= 20;
		}
		else{
			printString(0, 0, "placeCharacterWrong", 20);
		}
	}
	
	for(col = 0; col < colBound; col++){
		for(row = 0; row < rowBound; row++){
			if(array[count] != red){
				plot_pixel(row_off + x * 31 + row, 
						   col_off + y * 32 + col,  
						   array[count]);
			}
			count++;
		}
	}
	board[y][x] = CHARACTER;
}

void plotOneTile(int x, int y, short int colour){
	int col, row;
	int count = 0;
	
	const int offset = 88;
	int row_offset;
	const int col_offset = 10;
	
	if(y % 2 != 0) row_offset = offset + 12; //odd: more right
	else row_offset = offset;
	
	for (col = 0; col < 30; ++col) {
		for (row = 0; row < 30; ++row) {
			if(tile[count] != white) tile[count] = grey;
			if(tile[count] == grey){
				plot_pixel(row_offset + x *31 + row, 
						   col_offset + y *32 + col, 
						   colour);
			}
			count++;
		}
	}
}

void moveCharacter(int initialX, int initialY, int dir){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	
	plotOneTile(initialX, initialY, grey);
	int finalX = 0; int finalY = 0;
	int offset = 0;
	if(initialY % 2 == 0) offset = 1; //even
	
	//front正在display【人物被tile遮住】的画面，继续在front里画人物中间动作
	switch(dir){
		case 0: placeCharacter(initialX, initialY, toUpLeft, true);
				finalX = initialX - offset; finalY = initialY - 1;
				break;
		case 1: placeCharacter(initialX, initialY, toUpRight, true);
				finalX = initialX + 1 - offset; finalY = initialY - 1;
				break;
		case 2: placeCharacter(initialX, initialY, toRight, true);
				finalX = initialX + 1; finalY = initialY;
				break;
		case 3: placeCharacter(initialX, initialY, toBottomRight, true);
				finalX = initialX + 1 - offset; finalY = initialY + 1;
				break;
		case 4: placeCharacter(initialX, initialY, toBottomLeft, true);
				finalX = initialX - offset; finalY = initialY + 1;
				break;
		case 5: placeCharacter(initialX, initialY, toLeft, true);
				finalX = initialX - 1; finalY = initialY;
				break;
		default: printString(0,0, "DirError!",10);
	}
	
	// 在front正在display奔跑画面的时候，back buffer里redraw screen并画final位置
	// redraw完以后swap buffer to display
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // ptr 指向back buffer
	int row, col;
	int count = 0;
	for (col = 0; col < RESOLUTION_Y; ++col) {	// print background
        for (row = 0; row < RESOLUTION_X; ++row) {
            plot_pixel(row,col,backgroundColour);
        }
    }
	drawCountDown(duckCatchMe);
	printBoard();  // print blank tiles
	int i, j; // print obstacles
	for(i = 0; i < 7; i++){
		for(j = 0; j < 7; j++){
			if(board[j][i] == OBSTACLE){
				placeObstacle(i, j);
			}
		}
	}
	placeCharacter(finalX, finalY, duckState[duckIdx], false);
	board[initialY][initialX] = EMPTY;
	board[finalY][finalX] = CHARACTER;
	characterX = finalX; characterY = finalY;
	
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr);
}

// takes the key value and returns the next x and y coordinate through pointers
void updateCoordinate(int key, int* x, int* y){
		
	if (key == UP){
		/*
		// even
		if ((*y) % 2 == 0){
			(*x)--;
		}*/
		(*y)--;
	}
	if (key == DOWN){
		/*
		// odd 
		if ((*y) % 2 == 1){
			(*x)++;
		}*/
		(*y)++;
	}
	if (key == LEFT){
		(*x)--;
	}
	if (key == RIGHT){
		(*x)++;
	}
}


void updateCoordinateSix(int *x, int *y, int direction){
	// updates (x, y) coordinates specified direction 
	// six possible directions 

	switch(direction){

		case TOUPLEFT: 
			// even 
			if ((*y) % 2 == 0){
				(*x)--;
			}
			(*y)--;
			break;

		case TOUPRIGHT: 
			// odd 
			if ((*y) % 2 == 1){
				(*x)++;
			}
			(*y)--;
			break;

		case TORIGHT: 			
			(*x)++;
			break;

		case TOBOTTOMRIGHT: 
			// odd
			if ((*y) % 2 == 1){
				(*x)++;
			}
			(*y)++;
			break;

		case TOBOTTOMLEFT: 
			// even
			if ((*y) % 2 == 0){
				(*x)--;
			}
			(*y)++;
			break;

		case TOLEFT: 
			(*x)--;
			break;
				
		default: 
			printString(0,0, "DirError!",10);
			break;
	}
}


bool checkLegalInDirection(int board[7][7], int x, int y, int direction){
	// returns true if tile in the specified direction is empty

	updateCoordinateSix(&x, &y, direction);

	if (valid_place(board, x, y)){
		return true;
	}
	return false;
}


bool checkGameEnd(int board[7][7], int x, int y){
	// returns true if game ends
	
	// check if character has reached the edge of the board 
	if (x == 0 || y == 0 || x == 6 || y == 6){
		return true;
	}
		
	// check if character is surrounded by obstacles 
	// return false if at least one surrounding tile is empty
	int direction;
	for (direction = TOUPLEFT; direction <= TOLEFT; direction++){
		if (checkLegalInDirection(board, x, y, direction)){
			return false;
		}
	}
	return true;
}

bool atBoundary(int x, int y){
	return (x == 0 || x == 6 || y == 0 || y == 6);
}

int calculateScore(int board[7][7], int x, int y){
	// calculates the score of the tile at the specified coordinate 
	// score is the number of surrounding empty tiles at the boundary 
	// score is highest if tile at given coordinate is at boundary 

	int score = 0;
	const int BOUNDARYSCORE = 10;

	// preserve initial coordinate
	const int X = x;
	const int Y = y;

	if (atBoundary(x, y)){
		return BOUNDARYSCORE;
	}

	int direction;
	for (direction = TOUPLEFT; direction <= TOLEFT; direction++){

		// reset coordinates
		x = X;
		y = Y;

		if (checkLegalInDirection(board, x, y, direction)){

			updateCoordinateSix(&x, &y, direction);
			if(atBoundary(x, y)){
				score++;
			}
		}
	}
	return score;
}


void characterMakesMove(int board[7][7], int x, int y) {
    // the character moves to the tile with the highest score
    // note: assumes character is not surrounded by obstacles (at least one legal direction)

    // preserve initial coordinate
    const int X = x;
    const int Y = y;

    int maxScore = 0;
    int score = 0;
    int maxDirection = 0;
    int direction;

    // foundDir is true if a direction with score higher than 0 is found 
    bool foundDir = false;
    // a legal direction
    int worstCaseDir = 0;

    for (direction = TOUPLEFT; direction <= TOLEFT; direction++){

        // reset coordinates
        x = X;
        y = Y;

        if (checkLegalInDirection(board, x, y, direction)) {
            worstCaseDir = direction;

            updateCoordinateSix(&x, &y, direction);
            score = calculateScore(board, x, y);

            if (score > maxScore){
                maxScore = score;
                maxDirection = direction;
                foundDir = true;
            }
        }
    }

    // reset coordinates
    x = X;
    y = Y;

    if (!foundDir){
        maxDirection = worstCaseDir;
    }

    moveCharacter(x, y, maxDirection);
}


void displayRestart(void){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	
	deleteString();
	printScreen(restartScreen);
	
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);
} 

int findDirection(int direction, bool add){
	// find the direction constant 

	if (direction == TOUPLEFT && !add){
		direction = TOLEFT;
	}

	else if (direction == TOLEFT && add){
		direction = TOUPLEFT;
	}

	else {
		if (add){
			direction++;
		}
		else{
			direction--;
		}
	}
	return direction;
}


int selectNextAdjacentTile(int board[7][7], int key, int direction, int characterX, int characterY){
	// takes in a key and moves the select to the next valid and adjacent tile 

	// preserve initial character position
	const int initialCharacterX = characterX;
	const int initialCharacterY = characterY;

	updateCoordinateSix(&characterX, &characterY, direction);

	// preserve intial select position
	const int initialSelectX = characterX;
	const int initialSelectY = characterY;

	if (key == RIGHT){
		do {
			characterX = initialCharacterX;
			characterY = initialCharacterY;

			direction = findDirection(direction, true);
			updateCoordinateSix(&characterX, &characterY, direction);
		} while (!valid_place(board, characterX, characterY));
	}

	else {
		do {
			characterX = initialCharacterX;
			characterY = initialCharacterY;

			direction = findDirection(direction, false);
			updateCoordinateSix(&characterX, &characterY, direction);
		} while (!valid_place(board, characterX, characterY));
	}

	move_select(board, initialSelectX, initialSelectY, characterX, characterY);
	curSelX = characterX;
	curSelY = characterY;//test

	return direction;
}


int secondPlayerMovesCharacter(int board[7][7], int x, int y) {
	// second player uses left and right arrow keys to select 
	// one of the adjacent tiles for the character to move to

	// preserve initial character coordinate
	const int X = x;
	const int Y = y;

	int selectX = 0;
	int selectY = 0;

	int characterDirection = 0;

	// find initial select coordinate not occupied by obstacle
	int direction;
	for (direction = TOUPLEFT; direction <= TOLEFT; direction++){

        if (checkLegalInDirection(board, x, y, direction)) {

			updateCoordinateSix(&x, &y, direction);
			selectX = x;
			selectY = y;
			characterDirection = direction;

			// reset initial character coordinate
			x = X;
			y = Y;

			break;
		}
	}
	
	// display initial select position
	move_select(board, selectX, selectY, selectX, selectY);
	curSelX = selectX;
	curSelY = selectY;
	// move select when left or right arrow keys are pressed
	// find final direction character moves to
	backBufferSync();
	int input = poll_user_input(true);
	while(input != SPACE){

		if (input == LEFT || input == RIGHT){	
			// move select to next valid and adjacent position
			// find new characterDirection

			characterDirection = selectNextAdjacentTile(board, input, characterDirection, x, y);

		}
		
		if(input == R) {
			displayRestart();
			return R;
		}
		backBufferSync();
		input = poll_user_input(true);
	}
	moveCharacter(x, y, characterDirection);
	return NOKEY;
}

