void backBufferSync(){
		//back buffer同步
		volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
		int row, col;
		int count = 0;
		for (col = 0; col < RESOLUTION_Y; ++col) {	// print background
       		for (row = 0; row < RESOLUTION_X; ++row) {
            	plot_pixel(row,col,backgroundColour);
        	}
    	}
		drawCountDown(duckCatchMe);
		printBoard();  // print blank tiles
		int i, j; // print obstacles
		for(i = 0; i < 7; i++){
			for(j = 0; j < 7; j++){
				if(board[j][i] == OBSTACLE){
					placeObstacle(i, j);
				}
			}
		}
		placeCharacter(characterX, characterY, duckState[duckIdx], false);
		plotOneTile(curSelX, curSelY, blue);
		pixel_buffer_start = *(pixel_ctrl_ptr);
}

int main(void){
	
	srand(time(0));
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	
	// print start screen
	printScreen(startScreen);
	wait_for_vsync(); // swap front and back buffers on VGA vertical sync
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer	
	

	while(1){

		/******************** configure game initial state ********************/

		bool singlePlayer = true;

		int board_i = 0;
		int board_j = 0;
		for(board_i = 0; board_i < 7; board_i++){
			for(board_j = 0; board_j < 7; board_j++){
				board[board_i][board_j] = 0;
			}
		}
		// print board initial state
		int row, col;
		int count = 0;
		for (col = 0; col < RESOLUTION_Y; ++col) {
			for (row = 0; row < RESOLUTION_X; ++row) {
				plot_pixel(row,col,backgroundColour);
			}
		}
		printBoard();
		drawCountDown(duckCatchMe);
		
		
		// 等待space，直到space再开始display游戏界面
		while(poll_user_input(false) != SPACE){
			//wait_for_vsync(); // back现在是开屏，front是游戏初始界面
			//pixel_buffer_start = *(pixel_ctrl_ptr); // ptr指向front而不是back，
		}										    // 直接在游戏初始界面加东西
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr);
		
		// check if double player
		if ((*sw_pointer) == 1){
			singlePlayer = false;
		}
		
		/*****place character at random position *****/

		// position between index 2 to 4
		// rand() % (MAX - MIN + 1) + MIN
		characterX = 3;
		characterY = rand() % (4 - 2 + 1) + 2; 
		placeCharacter(characterX, characterY, duckState[duckIdx], false);
		
		/***** place obstacles at random positions *****/
		
		// obstacles cannot be intially generated at character's position
		// and at coordinate (0,0)
		const int initialObstacles = 6;
		int i;
		for(i = 0; i < initialObstacles; i++){
			int x = rand() % 7; 
			int y = rand() % 7;
			if(board[y][x] == EMPTY && !(x == 0 && y == 0)){
				placeObstacle(x, y);
			}else{
				i -= 1;
			}
		}
		/******************** game play 正式开始 ********************/
		
		bool endGame = false;
		
		while(!endGame){
			
			/***** select next obstacle to be placed *****/
			
			int selectX_cur = 0;
			int selectY_cur = 0;
			int selectX_new = 0;
			int selectY_new = 0;
			
			move_select(board, 0, 0, 0, 0);
			curSelX = 0;
			curSelY = 0;
			backBufferSync();
			
			int player = 0;
			int input = poll_user_input(true); 
			while(input != SPACE){
				int player = 0;
				updateCoordinate(input, &selectX_new, &selectY_new);
				
				// return back to previous coordinates if updated coordinates 
				// is out of bounds or contains obstacle
				if (!valid_place(board, selectX_new, selectY_new)){
					selectX_new = selectX_cur;
					selectY_new = selectY_cur;
				}
				
				move_select(board, selectX_cur, selectY_cur, selectX_new, selectY_new);
				
				// update select coordinates
				selectX_cur = selectX_new;
				selectY_cur = selectY_new;
				curSelX = selectX_cur;
				curSelY = selectY_cur;
				backBufferSync();
			    input = poll_user_input(true);
				
				if(input == R) {
					displayRestart();
					break;
				}
			}
			if(input == R){
				break;
			}
			plotOneTile(selectX_cur, selectY_cur, grey);
			placeObstacle(selectX_cur, selectY_cur);

			/***** character moves one spot *****/
			player = 1;
			// check if character is surrounded by obstacles 
			endGame = checkGameEnd(board, characterX, characterY);

			if (singlePlayer){

				if(!endGame){
					characterMakesMove(board, characterX, characterY);

					// check if character has moved to the boundary 
					endGame = checkGameEnd(board, characterX, characterY);
				}
				if(endGame && atBoundary(characterX, characterY)){
					displayDuckWin();
				}
				else if(endGame){
					displayPlayerWin();
				}
			
			}
			else{
				int test;
				if(!endGame){
					test = secondPlayerMovesCharacter(board, characterX, characterY);

					// check if character has moved to the boundary 
					endGame = checkGameEnd(board, characterX, characterY);
				}
				if(test == R) break;
				if(endGame && atBoundary(characterX, characterY)){
					displayDuckWin();
				}
				else if(endGame){
					displayPlayerWin();
				}
			}
		}
	}	
}
